import React from 'react';

import gmail from '../assets/images/gmail.png'
import linkedin from '../assets/images/linkedin.png'
import github from '../assets/images/github.png'

const styles = {
    footer: {
        position: 'fixed',
        left: '0',
        bottom: '0',
        width: '100%',
        backgroundColor: 'lightblue',
    }
};

function Footer() {

    return (
        <footer style={styles.footer}>
            <a href="mailto:joey.douek@gmail.com">
      <img src={gmail} alt="Joey Douek" height="25" width="25"></img>
      </a> 
      <a href="https://github.com/joeyblue27">
      <img src={github} alt="Joey Douek" height="25" width="25"></img>
      </a>
      <a href="https://www.linkedin.com/in/joey-douek-279908273">
      <img src={linkedin} alt="Joey Douek" height="25" width="25"></img>
      </a>
        </footer>
    );
};

export default Footer;
